import { createRouter, createWebHistory } from 'vue-router';

const routes = [
    { path: '/', component: () => import('./components/testapp.vue') },
  { path: '/trivia', component: () => import('./components/TriviaPage.vue') },
  { path: '/vorteile', component: () => import('./components/VorteilePage.vue') },
  { path: '/MobileApp', component: () => import('./components/MobileApp.vue') },
  { path: '/v-model', component: () => import('./components/v-model.vue') },
  { path: '/testapp', component: () => import('./components/testapp.vue') }
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
